import React from 'react';
import IndexSection from '../Sections/IndexSection'
import MoreInfoSection from '../Sections/MoreInfoSection';

function HomePage() {

    return (
        <>
            <div class='container'>

                <section id='index_section'>
                    <IndexSection />
                </section>
                <hr />
                <section id='info_section'>
                    <MoreInfoSection />
                </section>

            </div>
        </>
    );
}

export default HomePage;
